import './styling/ReportEntry.css';
import {formatDate} from '../utils/FormatDate'

const ReportEntry = ({report, onClickFunction}) => {
  const formattedDate = formatDate(report.createdAt);

  return (
    <div className = {`ReportEntry`} onClick = {onClickFunction}>
      <label className = "ReportDate">
        {formattedDate}
      </label>
      <label className = "ReportTitle">
        {report.title}
      </label>
      { report.studentInfo &&
        <label className = "ReportAuthor">
          {report.studentInfo.name}
        </label>
      }
    </div>
  );
}

export default ReportEntry;
